import React from 'react';
import {BrowserRouter as Router , Switch, Route} from 'react-router-dom';
import Upload from './components/Upload'
import './App.css'


function App() {
  return (
    <Router>
        <div className="App">
          {/* <Route path="/" component={Home} /> */}
          <Route path="/upload" component={Upload} />
        </div>  
    </Router>
  );
}

const Home = () =>{
  <div>
      <h5>MPS Test</h5>
  </div>
};

export default App;
